<script>
function toggleMapTypeDropdown() {
    const dropdown = document.getElementById('map-type-dropdown');
    dropdown.classList.toggle('active');
    
    // Close on outside click
    if (dropdown.classList.contains('active')) {
        document.addEventListener('click', function closeDropdown(e) {
            if (!document.getElementById('map-type-menu').contains(e.target)) {
                dropdown.classList.remove('active');
                document.removeEventListener('click', closeDropdown);
            }
        });
    }
}

function changeMapType(type) {
    const currentParams = new URLSearchParams(window.location.search);
    const region = currentParams.get('region') || '';
    const round = currentParams.get('round') || '';
    
    let url = '/turf/map/' + type;
    if (region && region !== '') {
        url += '/' + region;
        if (round && round !== '') {
            url += '/' + round;
        }
    }
    
    window.location.href = url;
}

function handleSelectorChange() {
    const currentParams = new URLSearchParams(window.location.search);
    const type = currentParams.get('type') || 'unique';
    const regionSelect = document.getElementById('region-select');
    const roundSelect = document.getElementById('round-select');
    
    const region = regionSelect ? regionSelect.value : '';
    const round = roundSelect ? roundSelect.value : '';
    
    let url = '/turf/map/' + type;
    if (region && region !== '') {
        url += '/' + region;
        if (round && round !== '' && round !== '0') {
            url += '/' + round;
        }
    }
    
    window.location.href = url;
}

function initializeSelectors() {
    const currentParams = new URLSearchParams(window.location.search);
    const currentRegion = currentParams.get('region') || '0';
    const currentRound = currentParams.get('round') || '';
    const currentType = currentParams.get('type') || 'unique';
    
    // Set selector values
    const regionSelect = document.getElementById('region-select');
    const roundSelect = document.getElementById('round-select');
    
    if (regionSelect && currentRegion) {
        regionSelect.value = currentRegion;
    }
    
    if (roundSelect && currentRound) {
        roundSelect.value = currentRound;
    }
    
    // Update URL to reflect current selections if we have defaults set
    const hasRegion = regionSelect && regionSelect.value && regionSelect.value !== '';
    const hasRound = roundSelect && roundSelect.value && roundSelect.value !== '0' && roundSelect.value !== '';
    
    if (hasRegion || hasRound) {
        let expectedUrl = '/turf/map/' + currentType;
        if (hasRegion) {
            expectedUrl += '/' + regionSelect.value;
            if (hasRound) {
                expectedUrl += '/' + roundSelect.value;
            }
        }
        
        // Only update URL if it doesn't match what we expect
        const currentPath = window.location.pathname;
        if (currentPath !== expectedUrl && !currentPath.includes('/maps/')) {
            window.history.replaceState({}, '', expectedUrl);
        }
    }
}
</script>

<!-- Initialize selectors when page loads -->
<script>
function setResponsiveMapHeight() {
    const mapContainer = document.getElementById('map-container');
    const menu = document.querySelector('.topnav');
    
    if (mapContainer && menu) {
        // Get actual heights
        const menuHeight = menu.offsetHeight;
        const viewportHeight = window.innerHeight;
        
        // Calculate available height
        const availableHeight = viewportHeight - menuHeight;
        
        // Set the height directly
        mapContainer.style.height = Math.max(200, availableHeight) + 'px';
        
        // Tell map to resize if it exists
        if (window.mapCore && window.mapCore.map) {
            setTimeout(() => window.mapCore.map.resize(), 100);
        }
    }
}

document.addEventListener('DOMContentLoaded', function() {
    initializeSelectors();
    // Set initial height after DOM is ready
    setTimeout(setResponsiveMapHeight, 100);
});

// Ensure map resizes when window resizes
window.addEventListener('resize', setResponsiveMapHeight);
window.addEventListener('orientationchange', function() {
    setTimeout(setResponsiveMapHeight, 300);
});
</script>
